// n8n Code Node (JavaScript) – Dropbox-Shared-Link -> Notion-tauglicher Raw-Link
// Erwartet: pro Item entweder ein Objekt mit .json.url ODER ein Item, dessen json ein Array dieser Objekte ist.
// Schreibt: json.url (überschrieben), json.notionUrl, json.changed, optional json.info/error.

const OVERWRITE_URL = true; // auf false setzen, wenn du das Originalfeld behalten willst

function parseHttpUrl(str) {
  const m = String(str || '').trim().match(/^https?:\/\/([^\/?#]+)([^?#]*)(\?[^#]*)?/i);
  if (!m) return null;
  return { host: m[1], path: m[2] || '/', query: m[3] || '', original: m[0] };
}

function parseQuery(qs) {
  const out = {};
  if (!qs) return out;
  const s = qs.replace(/^\?/, '');
  if (!s) return out;
  for (const part of s.split('&')) {
    if (!part) continue;
    const eq = part.indexOf('=');
    const k = eq >= 0 ? part.slice(0, eq) : part;
    const v = eq >= 0 ? part.slice(eq + 1) : '';
    const key = decodeURIComponent(k || '');
    const val = decodeURIComponent(v.replace(/\+/g, ' '));
    if (key) out[key] = val;
  }
  return out;
}

function buildQuery(obj) {
  const pairs = [];
  for (const [k, v] of Object.entries(obj)) {
    if (v === undefined || v === null || v === '') continue;
    pairs.push(encodeURIComponent(k) + '=' + encodeURIComponent(String(v)));
  }
  return pairs.length ? '?' + pairs.join('&') : '';
}

function toNotionUrl(input) {
  const parsed = parseHttpUrl(input);
  if (!parsed) {
    return { notionUrl: input, changed: false, error: 'Keine gültige http/https-URL.' };
  }

  const host = parsed.host.toLowerCase();
  const isDropbox =
    /(^|\.)dropbox\.com$/.test(host) || /(^|\.)dropboxusercontent\.com$/.test(host);

  if (!isDropbox) {
    return { notionUrl: input, changed: false, info: 'Keine Dropbox-URL – unverändert.' };
  }

  const path = parsed.path;
  const params = parseQuery(parsed.query);
  const rlkey = params.rlkey;

  const isFileShare = /^\/s\//i.test(path) || /^\/scl\/fi\//i.test(path);

  if (isFileShare) {
    // Raw-Link bauen (nur rlkey mitnehmen)
    const newHost = 'dl.dropboxusercontent.com';
    const q = rlkey ? buildQuery({ rlkey }) : '';
    const out = `https://${newHost}${path}${q}`;
    return { notionUrl: out, changed: out !== parsed.original };
  } else {
    // Fallback: Download-Link (?dl=1). Notion kann das meist NICHT als Bild einbetten.
    params.dl = '1';
    delete params.raw;
    delete params.preview;
    const q = buildQuery(params);
    const out = `https://${parsed.host}${path}${q}`;
    return {
      notionUrl: out,
      changed: out !== parsed.original,
      info: 'Fallback (?dl=1), da kein Datei-Share-Link (/s/ oder /scl/fi/).',
    };
  }
}

// 1) Input aus n8n holen
const incoming = $input.all();

// 2) Falls ein Item ein ARRAY in item.json enthält, auf einzelne Items „entpacken“
const normalized = [];
for (const it of incoming) {
  if (Array.isArray(it.json)) {
    for (const el of it.json) normalized.push({ json: el });
  } else {
    normalized.push(it);
  }
}

// 3) Jedes Item verarbeiten
const outItems = normalized.map(item => {
  const inputUrl =
    item.json?.url ??
    item.json?.link ??
    item.json?.shared_link ??
    item.json?.sharedLink ??
    item.json?.href ??
    item.url;

  if (!inputUrl) {
    return { json: { ...item.json, notionUrl: null, changed: false, error: 'Kein URL-Feld gefunden.' } };
  }

  const res = toNotionUrl(inputUrl);

  const outJson = {
    ...item.json,
    notionUrl: res.notionUrl,
    changed: !!res.changed,
  };
  if (res.info) outJson.info = res.info;
  if (res.error) outJson.error = res.error;

  if (OVERWRITE_URL) {
    outJson.url = res.notionUrl; // Originalfeld überschreiben, damit sofort sichtbar
  }

  return { json: outJson };
});

return outItems;

// n8n Code Node (JavaScript)
// Input: item.json.notionUrl (oder item.json.url) = Notion-Seitenlink
// Output pro Item:
//   - json.deepLink        -> notion://www.notion.so/... (öffnet direkt die App)
//   - json.universalLink   -> https://www.notion.so/... (Fallback/Universal Link)
//   - json.markdown        -> "[In Notion öffnen](notion://...) • [Im Browser](https://...)"
//   - json.changed         -> bool, ob normalisiert wurde
// Keine Nutzung von URL/URLSearchParams (kompatibel mit n8n Code Node)

function parseHttpUrl(str) {
  const m = String(str || '').trim().match(/^https?:\/\/([^\/?#]+)([^?#]*)(\?[^#]*)?/i);
  if (!m) return null;
  return { host: m[1], path: m[2] || '/', query: m[3] || '' };
}

function normalizeNotionHost(host) {
  host = host.toLowerCase();
  // Alle Varianten auf www.notion.so zusammenführen
  if (host === 'notion.so' || host === 'www.notion.so') return 'www.notion.so';
  if (host.endsWith('.notion.site')) return 'www.notion.so';
  return host; // Unbekannt -> belassen
}

function buildUniversalFromAny(url) {
  const p = parseHttpUrl(url);
  if (!p) return null;

  const normHost = normalizeNotionHost(p.host);
  if (!/notion\.so$/.test(normHost)) {
    // kein Notion-Link -> nicht ändern
    return { universal: url, changed: false };
  }
  // Query (z. B. ?pvs=4, ?v=…) beibehalten
  const universal = `https://${normHost}${p.path}${p.query || ''}`;
  return { universal, changed: universal !== url };
}

function toDeepLink(universalUrl) {
  // Aus einem https://www.notion.so/... einen notion://www.notion.so/... bauen
  const p = parseHttpUrl(universalUrl);
  if (!p) return null;
  if (!/(^|\.)(notion\.so)$/.test(p.host.toLowerCase())) return null;
  return `notion://www.notion.so${p.path}${p.query || ''}`;
}

const items = $input.all();
const out = [];

for (const item of items) {
  const src =
    item.json?.notionUrl ??
    item.json?.url ??
    item.json?.href ??
    item.url;

  if (!src) {
    out.push({ json: { ...item.json, error: 'Kein Notion-Link im Item gefunden.' } });
    continue;
  }

  const uni = buildUniversalFromAny(src);
  if (!uni) {
    out.push({ json: { ...item.json, error: 'Ungültige URL.' } });
    continue;
  }

  const deep = toDeepLink(uni.universal);
  const markdown = `[In Notion öffnen](${deep}) • [Im Browser](${uni.universal})`;

  out.push({
    json: {
      ...item.json,
      deepLink: deep,
      universalLink: uni.universal,
      markdown,
      changed: !!uni.changed,
    }
  });
}

return out;

